import React from 'react'
import styled from 'styled-components'
const AppWrapper = styled.div`
    background :red ;
`;
const PageTitle = styled.h1`
    font-size: 30px;
`
export default class App extends React.Component{

    render(){
        return <AppWrapper >
            <PageTitle>App Pro</PageTitle>
        </AppWrapper>
    }
}
